import {Canvas} from "@react-three/fiber";
import {OrbitControls} from "three/examples/jsm/controls/OrbitControls";

export default function SectionThree() {
    const orbit= new OrbitControls()
    return (
        <Canvas>
            <mesh>
                {orbit}
                <boxGeometry args={[4,4,4]}/>
            </mesh>
        </Canvas>
    )
}
